import { Link } from "react-router-dom";
import './Header.css';
import logo from './logo.jpg';

const Header = () => {
    return ( 
        <nav className="header">
            <img src='logo.jpg'  className="logo"/>
            <div className="links">
                <p>Home</p>
                <p>login</p>
                <p>registration</p>
            </div>
        </nav>
     );
}
 
export default Header;
